import Todo from "./components/Todo";

const Example = () => {
  return (
    <>
      <h3>完成系と同じような機能を作成してください。</h3>
      <p>また、枠線で囲まれた部品をコンポーネントに分離してください。</p>
    </>
  );
};

export default Example;
